import React from "react";
import "../App.css";
import "../styles/SidebarMenu.css";
import { Link, useSearchParams } from "react-router-dom";

const SideBar = ({ userState }) => {
  const userSideBar = (userState) => {
    switch (userState) {
      case 0: //비회원
        return (
          <div>
            <Link className="loginRegisterBtn" to="/loginRegister">
              <div>
                <span>로그인/회원가입</span>
              </div>
              <button>
                <img src="../images/arrow.png"></img>
              </button>
            </Link>
          </div>
        );
      case 1: //손님
        return (
          <div>
            <Link className="loginRegisterBtn" to="/myPage">
              <div>
                <span>손님 닉네임</span>
                <span>자기소개...</span>
              </div>
              <button>
                <img src="../images/arrow.png"></img>
              </button>
            </Link>
          </div>
        );
      case 2: //사장님
        return;
      case 3:
        return;
    }
  };

  return <div className="sidebar">{userSideBar(userState)}</div>;
};

export default SideBar;
